import { Header } from "../../Components/Header";
import { StyledMain } from "./style";

export const DashboardPage = ({ user }) => {
  console.log(user);
  return (
    <>
      <Header />
      <StyledMain>
        <section>
          <div>
            <h2>Ol√°,{user.name}!</h2>
            <span>{user.course_module}</span>
          </div>
        </section>
        <h2>Que pena! Estamos em desenvolvimento :(</h2>
      </StyledMain>
    </>
  );
};
